import * as React from "react";
import RabbitAWhiteBorder from "./RabbitAWhiteBorder";

interface IRabbitAProps {
  handleMouseEnter: () => void;
  handleMouseLeave: () => void;
}

interface IRabbitAState {
  isHover: boolean;
}

class RabbitA extends React.Component<IRabbitAProps, IRabbitAState> {
  constructor(props: IRabbitAProps) {
    super(props);
    this.state = {
      isHover: false
    };
    this.handleMouseEnter = this.handleMouseEnter.bind(this);
    this.handleMouseLeave = this.handleMouseLeave.bind(this);
  }

  public render() {
    return (
      <svg
        className="rabbitA"
        version="1.1"
        xmlns="http://www.w3.org/2000/svg"
        x="0px"
        y="0px"
        viewBox="0 0 323 383.8"
        onMouseEnter={this.handleMouseEnter}
        onMouseLeave={this.handleMouseLeave}
      >
        {this.state.isHover ? <RabbitAWhiteBorder /> : null}
        <image width="315" height="375" transform="translate(1.87 3.75)" xlinkHref="data:image/png;base64,"/>
      </svg>
    );
  }

  private handleMouseEnter() {
    this.setState({
      isHover: true
    });

    this.props.handleMouseEnter();
  }

  private handleMouseLeave() {
    this.setState({
      isHover: false
    });

    this.props.handleMouseLeave();
  }
}

export default RabbitA;
